So something that’s been in the planning for a few months is finally here! This year as we celebrate 7 years of The Kyle Cassim Show I want to do something different. Something that’s never been done before! So instead of a normal event, I’m throwing an outdoor festival where I will be playing a 7-hour back-to-back set with 7 of my main resident DJs who have been with me throughout the years on @5fm . Each hour will showcase their individual sounds and how they have been a pillar of my show. If that’s not enough, before and after the 7-hour back-to-back there will be my other resident DJs showcasing their sounds! Tickets are now live and I’ve decided that the first 200 people will have access to R100 early bird tickets! 4 November we make history! Save the date and I’ll see you then! Ticket link in bio! 

